import express from "express";
import path from "path";
import http from "http";

import { Server } from "socket.io";
import { on } from "events";

const port = process.env.PORT || 3000;

let onlinePlayers = [];

const app = express();
const server = http.createServer(app);
const io = new Server(server, {
    cors: {
        origin: ["http://localhost:3000"]
    },
});

app.use(express.static("dist"));

const indexPath = path.join(process.cwd(), "dist", "index.html");

app.get("*", (req, res) => {
    res.sendFile(indexPath);
});

server.listen(port, () => {
    console.log(`Server listening on port ${port}`);
});

io.on("connection", (socket) => {

    onlinePlayers.push(socket.id);

    socket.emit("current-players", onlinePlayers);

    socket.on("player-join", (name, x, y) => {
        socket.broadcast.emit("player-join", name, socket.id);
    });

    socket.on('zoom', (zoom) => {
        socket.broadcast.emit('zoom', zoom);
    });

    socket.on('player-movement', (x, y) => {
        socket.broadcast.emit('player-movement', x, y, socket.id);
    });

    socket.on('disconnect', () => {
        let newPlayersArray = [];

        for (let i = 0; i < onlinePlayers.length; i++) {
			if (onlinePlayers[i] != socket.id) {
				newPlayersArray.push(onlinePlayers[i]);
			}

			onlinePlayers = newPlayersArray;
		}

        socket.broadcast.emit('player-leave', socket.id, onlinePlayers, socket.id);

        // console.log(onlinePlayers);
    });

    socket.on('message', (message, date, username, type) => {
        socket.broadcast.emit('message-world', message, date, username, type);
    });

    socket.on('request-world', () => {
        socket.emit('send-world', worldData);
    });
});